  [],\n\t\"revision_timestamp\": \"2016-07-27T22:55:32.538319\",\n\t\"name\": \"madison-wetland-management-district-annual-narrative-report-calendar-year-1985\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Madison
  WMD outlines accomplishments during the 1985 calendar year. The report begins with
  a summary of the year's highlights and weather conditions. The report includes a
  planning section which discusses compliance with environmental and cultural resource
  mandates and research and investigations. District administration is outlined; information
  about personnel, youth programs, manpower programs, volunteer programs, funding,
  safety, and technical assistance is given. Habitat management is also covered; subjects
  include wetlands, forests, croplands, grasslands, haying, fire management, pest
  control, and WPA easements. The wildlife section of the report discusses wildlife
  diversity, endangered and threatened species, waterfowl, marsh birds and waterbirds,
  shorebirds, raptors, game mammals, fisheries resources, and disease control. The
  public uses of the WMD described in this report include outdoor classrooms, interpretive
  programs, hunting, fishing, trapping, wildlife observation, outdoor recreation,
  and law enforcement. The equipment and facilities section of the report provides
  information about new construction, rehabilitation, major maintenance, equipment
  replacement, communication systems, and energy conservation. Cooperative programs
  and items of interest are provided at the end.\",\n\t\"license_title\": \"License
